import profileCon from '../assets/images/profileConsole.JPEG'

const About = () => {
  return (
    <>
      <div>
        <h1>ABOUT</h1>
      </div>
      <div>
        <img src={profileCon}
          alt="profileConsole"
        />
      </div>
    </>
  )
}

export default About;
